import logo from './logo.svg';
import './App.css';

function App() {
  return (

      <body>
      <section class="section">
        <div class="container">
          <h1 class="title">
            Hello World
          </h1>
          <p class="subtitle">
            My first website with <strong>Bulma</strong>!
          </p>
        </div>
      </section>
      </body>
  );
}

export default App;
